    const feed = props.data.map(post => 
        <Post 
            data={post} 
            mode={props.mode}
            paragraph={<Lorem count={1}/>}
            author={
                <Lorem 
                    count={1}
                    paragraphUpperBound={1}
                    sentenceUpperBound={2}
                />
